import React from 'react'
import SearchResult from './SearchResult'

export default function SearchResultsList({results}) {
  return (
    <>
        <div>
            {results.map((result , id)=>{
                return <SearchResult result={result.tracking} />
            })}
        </div>
    </>
  )
}
